////////////////////////////////    ABOUT FORCE FIELD    ///////////////////////////////////////
/**********************************************************************************************/
/*                                                                                            */
/*  A force field (also called a forcefield) refers to the functional form and parameter      */
/*  sets used to describe the potential energy of a system of particles (typically but not    */
/*  necessarily atoms).                                                                       */
/*                                                                                            */
/*                                                   Ponder JW and Case DA. (2003)            */
/*                                                   "Force fields for protein simulations"   */
/*                                                   Adv. Prot. Chem. 66: 27-85.              */
/*                                                                                            */
/*                                                                                            */
/*                                                                                            */
/*  Parameters used in AMBER package are taken from following references.                     */
/*                                                                                            */
/*  Ref. 1 :                                                                                  */
/*  Scott et al., "A New Force Field for Molecular Mechanical Simulation of Nucleic Acids     */
/*  and Proteins", J. Am. Chem. Soc. 1984, Vol. 106, 765-784.                                 */                                       
/*                                                                                            */
/*  Ref. 2 :                                                                                  */
/*  Wendy D. Cornell et al., "A Second Generation Force Field for the Simulation of Proteins, */ 
/*  Nucleic Acids, and Organic Molecules", J. Am. Chem. Soc., Vol. 117, No. 19, 1995          */
/*                                                                                            */
/**********************************************************************************************/
////////////////////////////////////////////////////////////////////////////////////////////////


